INSERT INTO `sys_oper_log` VALUES (526, '软件版本信息', 2, 'com.ruoyi.web.controller.system.SysAppVersionController.edit()', 'PUT', 1, 'admin', NULL, '/system/appVersion', '127.0.0.1', '内网IP', '{\"app\":{\"freeQuotaReg\":0,\"reduceQuotaUnbind\":0,\"description\":\"百度网盘（原百度云）是百度推出的一项云存储服务，已覆盖主流PC和手机操作系统，包含Web版、Windows版、Mac版、Android版、iPhone版和Windows Phone版。\",\"delFlag\":\"0\",\"loginLimitU\":-1,\"updateBy\":\"admin\",\"appId\":1,\"authType\":\"ACCOUNT\",\"limitOper\":\"TIPS\",\"appName\":\"软件-账号计时\",\"billType\":\"TIME\",\"bindType\":\"ONE_TO_ONE\",\"dataExpireTime\":-1,\"loginCodeLen\":32,\"updateTime\":1638597985000,\"heartBeatTime\":300,\"loginLimitM\":-1,\"params\":{},\"dataOutEnc\":\"NONE\",\"createBy\":\"admin\",\"createTime\":1636174141000,\"dataInEnc\":\"NONE\",\"developer\":{\"phonenumber\":\"15888888888\",\"admin\":true,\"loginDate\":1639891591000,\"delFlag\":\"0\",\"updateBy\":\"admin\",\"loginIp\":\"127.0.0.1\",\"email\":\"ry@163.com\",\"nickName\":\"管理员\",\"sex\":\"1\",\"deptId\":103,\"updateTime\":1638597985000,\"avatar\":\"http://localhost:99/1.jpg\",\"params\":{},\"userName\":\"admin\",\"userId\":1,\"createBy\":\"admin\",\"createTime\":1636174141000,\"status\":\"0\"},\"isCharge\":\"Y\",\"loginCodeGenRule\":\"NUM_UPPERCASE_LOWERCASE\",\"status\":\"0\"},\"appVersionId\":1,\"downloadUrl\":\"httwadwp://www.baidu.com\",\"remark\":\"0120\",\"updateLog\":\"1、新增任务模式选项，可将客户端切换为队员模式，此时该客户端相当于只选择了\\\"队员模式\\\"，将不再执行已选任务列表中的任务，可达到一个脚本同时控制两个客户端并进行组队的效果\\n2、新增探索副本结算加速功能，开启后会提升探索副本结算速度，但会造成\\\"数据统计\\\"页面战斗胜利/失败次数无法准确统计\\n3、新增探索副本在结束时如果发现探索宝箱将会自动拾取（非boss宝箱）\\n4、修复队员模式有时会卡在探索难度选择界面的问题\\n5、修复探索副本的邀请好友功能在使用脚本截图时造成脚本崩溃的问题\\n6、修复探索副本组队邀请好友有时会卡在选择难度界面的问题\\n7、优化探索副本修改为默认不攻打石矩、年兽、妖气、碎片\\n8、优化在选择自动保存日志情况下停止脚本会无响应的问题\\n9、优化探索副本如果中途退出不会退回探索，直接从难度选择界面开始战斗\\n10、优化御魂和觉醒的组队邀请好友的一些问题\\n11、其他细节优化\",\"updateTime\":1639898546578,\"params\":{},\"versionName\":\"v1.4.5\",\"createBy\":\"\",\"updateBy\":\"\",\"appId\":1,\"versionNo\":1,\"md5\":\"adwadawdawdawdawfadawdaw\",\"status\":\"0\"}', '{\"msg\":\"操作成功\",\"code\":200}', 0, NULL, '2021-12-19 15:22:26');
