INSERT INTO `sys_oper_log` VALUES (892, '软件版本信息', 2, 'com.ruoyi.web.controller.system.SysAppVersionController.edit()', 'PUT', 1, 'admin', NULL, '/system/appVersion', '127.0.0.1', '内网IP', '{\"app\":{\"freeQuotaReg\":0,\"reduceQuotaUnbind\":0,\"description\":\"百度网盘（原百度云）是百度推出的一项云存储服务，已覆盖主流PC和手机操作系统，包含Web版、Windows版、Mac版、Android版、iPhone版和Windows Phone版。\",\"delFlag\":\"0\",\"loginLimitU\":-1,\"apiUrl\":\"http://www.coordsoft.com:81/prod-api/api/v1/fesgsghsrhsrdhdrhdh\",\"updateBy\":\"admin\",\"appId\":1,\"appKey\":\"fesgsghsrhsrdhdrhdh\",\"authType\":\"ACCOUNT\",\"limitOper\":\"TIPS\",\"apiPwd\":\"\",\"appName\":\"软件-账号计时\",\"billType\":\"TIME\",\"bindType\":\"NONE\",\"dataExpireTime\":-1,\"updateTime\":1643908289000,\"heartBeatTime\":300,\"loginLimitM\":-1,\"offNotice\":\"软件正在维护中\",\"params\":{},\"dataOutEnc\":\"NONE\",\"createBy\":\"admin\",\"welcomeNotice\":\"欢迎您使用本软件\",\"createTime\":1636174141000,\"dataInEnc\":\"NONE\",\"appSecret\":\"esgsgshsrhs\",\"developer\":{\"admin\":false,\"nickName\":\"管理员\",\"params\":{},\"userName\":\"admin\",\"userId\":3},\"isCharge\":\"Y\",\"status\":\"0\"},\"appVersionId\":1,\"versionShow\":\"v1.4.5(1)\",\"downloadUrl\":\"http://www.baidu.com\",\"remark\":\"0120\",\"updateLog\":\"1、新增任务模式选项，可将客户端切换为队员模式，此时该客户端相当于只选择了\\\"队员模式\\\"，将不再执行已选任务列表中的任务，可达到一个脚本同时控制两个客户端并进行组队的效果\\n2、新增探索副本结算加速功能，开启后会提升探索副本结算速度，但会造成\\\"数据统计\\\"页面战斗胜利/失败次数无法准确统计\\n3、新增探索副本在结束时如果发现探索宝箱将会自动拾取（非boss宝箱）\\n4、修复队员模式有时会卡在探索难度选择界面的问题\\n5、修复探索副本的邀请好友功能在使用脚本截图时造成脚本崩溃的问题\\n6、修复探索副本组队邀请好友有时会卡在选择难度界面的问题\\n7、优化探索副本修改为默认不攻打石矩、年兽、妖气、碎片\\n8、优化在选择自动保存日志情况下停止脚本会无响应的问题\\n9、优化探索副本如果中途退出不会退回探索，直接从难度选择界面开始战斗\\n10、优化御魂和觉醒的组队邀请好友的一些问题\\n11、其他细节优化\",\"updateTime\":1643972986165,\"forceUpdate\":\"Y\",\"params\":{},\"versionName\":\"v1.4.5\",\"createBy\":\"\",\"updateBy\":\"admin\",\"appId\":1,\"versionNo\":1,\"md5\":\"d41d8cd98f00b204e9800998ecf8427e|bfdf46fcdfda2952cd70de0dcc4af6e2|0829fb73717e2ec8b62da2641fba084b|51e3de0c7a2bac4f9266b3638748a8f8|837dbc5b8c84bbe971062beb18ba4e11|29c016c19d