INSERT INTO `sys_oper_log` VALUES (1456, '卡密模板', 2, 'com.ruoyi.web.controller.system.SysCardTemplateController.edit()', 'PUT', 1, 'admin', NULL, '/system/cardTemplate', '124.64.18.150', '北京市 北京市', '{\"cardName\":\"年卡\",\"firstStock\":\"Y\",\"templateId\":6,\"cardPassGenRule\":\"NUM_UPPERCASE_LOWERCASE\",\"cardNoGenRule\":\"NUM_UPPERCASE_LOWERCASE\",\"chargeRule\":\"NONE\",\"updateBy\":\"admin\",\"cardNoLen\":20,\"price\":1000,\"appId\":1,\"quota\":31104000,\"onSale\":\"Y\",\"effectiveDuration\":-1,\"app\":{\"description\":\"百度网盘（原百度云）是百度推出的一项云存储服务，已覆盖主流PC和手机操作系统，包含Web版、Windows版、Mac版、Android版、iPhone版和Windows Phone版。\",\"appId\":1,\"authType\":\"ACCOUNT\",\"appName\":\"软件-账号计时\",\"billType\":\"TIME\",\"params\":{}},\"cardPassLen\":20,\"updateTime\":1647791160968,\"params\":{},\"enableAutoGen\":\"Y\",\"createBy\":\"\",\"createTime\":1638372069000,\"status\":\"0\"}', '{\"msg\":\"操作成功\",\"code\":200}', 0, NULL, '2022-03-20 23:46:01');
INSERT INTO `sys_oper_log` VALUES (1457, '通知公告', 2, 'com.ruoyi.web.controller.system.SysNoticeController.edit()', 'PUT', 1, 'admin', NULL, '/system/notice', '124.64.18.150', '北京市 北京市', '{\"noticeContent\":\"<ul><li>你说我的眼睛灿若星辰，那是因为你是星辰，而我的眼中只有你。</li><li>温暖的夏日，一杯香浓的咖啡，一份美味的冰淇淋，青春就是这么甜美。</li><li>站在青春的夕阳下，感受着过往，留下浅浅的笑靥，这大概就是我们的狂欢过得青春。</li><li>大海之于小溪，阳光之于地球，蓝天之于白云，棉花糖之于小朋友，美梦之于你，你之于我。</li><li>我喜欢那些闪光的东西，比如冬日的雪花，天上的星星，还有你的眼睛。</li><li>春阳灿灿，夏山如碧，秋蜩抱朴，冬日烈烈，皆愿与君长相随。</li><li>看天空的云，堆在了一起。看躺在地上的你，微笑的脸庞。</li><li>快乐很简单，就是春天的鲜花，夏天的绿荫，秋天的野果，冬天的漫天飞雪。</li><li>无数的花瓣轻轻摇曳，积攒着彩虹般的梦，承载着我的思念。</li><li>往事不必再提，人生已多风雨，我只愿风止于秋水，而我止于你。</li></ul>\",\"createBy\":\"admin\",\"createTime\":1635392028000,\"updateBy\":\"admin\",\"noticeType\":\"0\",\"remark\":\"管理员\",\"updateTime\":1647447755000,\"params\":{},\"noticeId\":1,\"noticeTitle\":\"商店公告\",\"status\":\"1\"}', '{\"msg\":\"操作成功\",\"code\":200}', 0, NULL, '2022-03-21 00:04:27');
